import React from "react";
import { GoogleLogin } from "react-google-login";

const responseGoogle = (response) => {
	console.log(response);
};

const onSuccess = (response) => {
    console.log('Login successfully, res: ', response);
}

const onFailure = (response) => {
    console.log('Authentication unsuccesfull, res: ', response)
}

function GoolgeSignUp() {


	return (
		<GoogleLogin
			clientId='690533023919-jgfsuo3d9oi1crm1ik672r7vdrlig70r.apps.googleusercontent.com'
			onSuccess={responseGoogle}
			onFailure={responseGoogle}
			cookiePolicy={"single_host_origin"}
		/>
	);
}

export default GoolgeSignUp;
